definition.script:
pipeline {
    agent any
    stages {
        stage('clone') {
            steps {
		        sh 'git --version'
                git url: 'https://github.com/DaGeRe/demo-with-jenkinsfile'
            }
        }
	    stage('Test') {
            steps {
                measure VMs: 2,
		        iterations: 2,
		        measurementMode: 'COMPLETE',
		        repetitions: 1,
	        	useSampling: false,
		        useSourceInstrumentation: false,
		        warmup: 0
            }
        }
    }
}
